import React from 'react';
import styled from 'styled-components';

const Left = () => {
    return (
        <Style>
            <header>
                <i class="fas fa-circle-notch"></i>
                <button> Start again </button>
            </header>
        </Style>
    );
}

export default Left;

const Style = styled.div`
    background: #121E33;
    min-height: 100vh;
`
